INSERT INTO `secciones` VALUES (4,'home','Inicio','ALTOS de SAN JOSE','<p>\n	ALTOS DE SAN JOS&Eacute;11111</p>\n<p>\n	&nbsp;</p>\n<p>\n	Es un emprendimiento &uacute;nico en San Miguel.</p>\n<p>\n	<br />\n	Dirigido a las familias de esta ciudad y aleda&ntilde;os por su inmejorable ubicaci&oacute;n.</p>\n<p>\n	<br />\n	Emplazado a s&oacute;lo 15 cuadras del casco urbano de San Miguel, donde se encuentran los principales Colegios, Centros M&eacute;dicos, Comercios y Oficinas.</p>\n<p>\n	<br />\n	El ingreso al predio se encuentra sobre una Avenida con tres carriles por mano.</p>\n<p>\n	<br />\n	Lindero al Emblem&aacute;tico Colegio M&aacute;ximo de San Jos&eacute;, Centro Loyola, la Universidad de El Salvador, y a metros de donde se desarrolla el nuevo centro comercial de la firma Easy.<br />\n	<br />\n	<strong>Lotes de 600 m2 promedio por parcela</strong></p>\n',0,NULL,0,1,'','comun'),(10,'educacion','Educacion','Educacion en Comarcas de Lujan','<p>\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque at nulla odio, at scelerisque mi. Suspendisse imperdiet euismod purus nec aliquet. Morbi ac odio magna, a pulvinar ipsum. Vestibulum viverra sem vitae risus molestie tincidunt. Suspendisse vel tortor urna, non fermentum libero. Nullam sit amet nibh ante. Sed dignissim urna vel elit lobortis mollis. Vivamus risus quam, scelerisque at ultricies at, semper in mauris. Vestibulum feugiat iaculis vestibulum. Maecenas turpis enim, euismod nec lobortis id, condimentum quis purus. Aenean non ipsum eget odio blandit ullamcorper eget ut diam.</p>\n',2,NULL,9,1,',2','comun'),(9,'deportes','Deportes y Esparcimiento','Deportes en Comarcas de Lujan','<p>\n	Sendero Aer&oacute;bico<br />\n	Bicisenda<br />\n	Plazas de juegos1111111<br />\n	Club House</p>\n',1,NULL,0,1,',2','comun'),(15,'naturaleza','Naturaleza','','',3,NULL,0,1,',2','comun'),(17,'comollegar','Como Llegar','','<p>\n	Bme Mitre ( ruta 23 ) al 3000</p>\n',5,NULL,0,1,'','mapa'),(18,'contacto','Contacto','',''